import React from 'react'

const AddTaskListForm = ({taskListForm}) => {

  const formSubmit = e =>{
    e.preventDefault();
  }
  return(
    <div className="add-task-list-form">
      <form>
      {taskListForm.toLocaleString()}
        <label>AddTaskListForm</label>
        <input></input>
        <button className="add-column-btn" type="submit" onClick={formSubmit}>Add</button>
        <button className="close" type="button" onClick={()=>{taskListForm = false}}>
          <i className="fas fa-plus"></i>
        </button>
      </form>
    </div>
  )
}


export default AddTaskListForm;
